import React from "react";
import photo1 from "../images/TicTacToe.png"
import photo2 from "../images/Calculator.png"

const Projects = () => {
    return (
        <div className="App-projects">
            <h1 className="section-title">Projects</h1>
            <div className="container">
                <div className="preview">
                    <img src={photo1} alt='My photo' className='my-photo' />
                </div>
                <h1 className="preview-title">Tic Tac Toe</h1>
            </div>
            <div className="container">
                <div className="preview">
                    <img src={photo2} alt='My photo' className='my-photo' />
                </div>
                <h1 className="preview-title">Calculator</h1>
            </div>
        </div>
    );
};

export default Projects;
